import { request } from "../configs/axios";

const fetchMovieShowTimeApi = () => {
  return request({
    url: `/QuanLyRap/LayThongTinLichChieuPhim?MaPhim=${movieId}`,
    method: "GET",
  });
};
export {fetchMovieShowTimeApi};
